package findallanagram

import (
	"fmt"
)

func isAnagram(s, p string) bool {
	parentStringMap := make(map[rune]int)
	for _, value := range s {
		if _, ok := parentStringMap[value]; !ok {
			parentStringMap[value] = 1
			continue
		}
		parentStringMap[value] += 1
	}
	for _, value := range p {
		_, ok := parentStringMap[value]
		if !ok || parentStringMap[value] <= 0 {
			return false
		}
		parentStringMap[value] -= 1
	}
	return true
}

func findAnagrams(s string, p string) []int {
	i := 0
	res := []int{}
	lengthP := len(p)
	for i < len(s) {
		if i+lengthP > len(s) {
			break
		}
		if isAnagram(s[i:i+lengthP], p) {
			res = append(res, i)
		}
		i++
	}
	return res
}

